import React from 'react'
import { Rooms } from '../../classes'

function EducatorRoomData() {
    let roomList: Rooms[] = [
        new Rooms("Babies"), new Rooms("Toddlers"), new Rooms("Pre Kindergarten"), new Rooms("Kindergarten"), new Rooms("PreSchool")
    ]

  return (
      <div className='educator-data-grid'>
          {roomList.map((room, index) => (
              <div key={index}>
                  {room.getRoomName()}
              </div>
          ))}
      </div>
  )
}

export default EducatorRoomData
